import React from 'react';
import EditItem from './EditItem'


function ToDoItem(props) {

    return ( 
        <div onClick={ () => {
            props.onChecked(props.id)
        } }>
            <div>
                <li>{props.text}</li>
            </div>
            <EditItem />
        </div>
    )
}

export default ToDoItem;
